INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (100, "", 40000, 36, "", 0, 0, 0, 91002, 1, 8);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 40001, 37, "ぺコリーヌ", 1, 0, 107501, 91002, 1, 8);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 40001, 38, "コッコロ", 1, 0, 107601, 91002, 2, 8);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 40001, 39, "キャル", 1, 0, 107801, 91002, 3, 8);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 40001, 40, "スズメ", 1, 0, 107701, 91002, 4, 8);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 40001, 41, "タマキ", 1, 0, 107901, 91002, 5, 8);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 40001, 42, "ぺコリーヌ", 2, 0, 107501, 91002, 6, 8);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 40001, 43, "コッコロ", 2, 0, 107601, 91002, 7, 8);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 40001, 44, "キャル", 2, 0, 107801, 91002, 8, 8);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 40001, 45, "スズメ", 2, 0, 107701, 91002, 9, 8);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 40001, 46, "タマキ", 2, 0, 107901, 91002, 10, 8);
