INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 40011, 321, "リリ", 1, 0, 125801, 24001, 1, 2);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 40011, 322, "クリア", 1, 0, 126001, 24001, 2, 2);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, "んーと。\nこれ、あげる。\nはい", 40011, 323, "プレシア", 1, 0, 126101, 24001, 3, 2);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 40011, 324, "リリ", 2, 0, 125801, 24001, 4, 2);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 40011, 325, "クリア", 2, 0, 126001, 24001, 5, 2);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, "お兄。\nきてくれて、うれしい", 40011, 326, "プレシア", 2, 0, 126101, 24001, 6, 2);
